import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      {/* Navigation Bar */}
      <nav className="navbar">
        <h2>Finance Portal</h2>
      </nav>

      {/* Main content */}
      <div className="main-content">
        <h1>All things finance,<br> right here.</br></h1>

        {/* Image/Graph placeholder */}
        <div className="graph-container">
          <img
            src="https://example.com/your-graph-image.png"
            alt="Finance Graph"
            className="graph-image"
          />
        </div>

        {/* Get Started Button */}
        <button className="get-started-button">Get Started</button>
      </div>
    </div>
  );
}

export default App;
